import logo from './logo.svg';
import './App.css';
import Header from './components/header';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        // <h1>Em Contrução</h1>
        // <h2>Retorne Em Alguns Dias</h2>

        <Header />
      </header>
    </div>
  );
}

export default App;
